import React from "react";
import { useNavigate } from "react-router-dom";
import "../styles/dashboard.css";

/* ðŸ”½ YE YAHA ADD KARO ðŸ”½ */
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  Tooltip,
  Legend,
} from "chart.js";

import { Line, Bar } from "react-chartjs-2";

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  Tooltip,
  Legend
);
/* ðŸ”¼ YAHAN TAK ðŸ”¼ */

function Dashboard() {
  const navigate = useNavigate();

  const lineData = {
    labels: ["Mon", "Tue", "Wed", "Thu", "Fri"],
    datasets: [
      {
        label: "Weekly Sales",
        data: [5, 12, 8, 20, 15],
        borderWidth: 2,
      },
    ],
  };

  const barData = {
    labels: ["Products", "Orders"],
    datasets: [
      {
        label: "Count",
        data: [12, 0],
      },
    ],
  };

  return (
    <div className="dashboard">
      {/* cards + charts */}
      <Line data={lineData} />
      <Bar data={barData} />
    </div>
  );
}

export default Dashboard;
